import React, { Component } from 'react'

export default class Project extends Component {
    constructor(props) {
        super(props)
        this.state = {
            Projects: [],
        }
    }
    componentDidMount() {
        (async () => {
            const rawResponse = await fetch('/projects/', {
                method: 'GET',
                headers: {
                    'Accept': 'application/json',
                    'Content-Type': 'application/json'
                }
            });

            await rawResponse.json().then(data => this.setState({ Projects: data }));
        })();
    }

    handleChangeProject(event) {
        props.onChange(event.target.value);
    }

    render() {
        return (
            <select className="form-control" onChange={e => props.onChange(e.target.value)}>
                <option value=""></option>
                {this.state.Projects.map((project, index) => {
                    return (
                        <option key={index} value={project._id}>{project.Name}</option>
                    )
                })}
            </select>
        )
    }
}
